import React from "react";
import { useState } from "react";
import { Modal, Button } from "react-bootstrap";
import "./Rake_Form.css";

function RakeForm() {
  const cellStyle1 = {
    border: "0.3px solid white",
    padding: "8px",
    background: "#0eacb3",
    color: "white",
    fontSize: "12px",
    fontWeight: "400",
    width: "150px",
  };
  const cellStyle2 = {
    border: "0.3px solid white",
    padding: "8px",
    background: "#75d0d4",
    color: "white",
    fontSize: "13px",
    fontWeight: "300",
    width: "400px",
  };
  const [show, setShow] = useState(false);
  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);
  const [get,getvalue] = useState(false);
  var getValue;
  const getit = () => {
    getvalue(true);
    getValue = document.getElementById('Loaded_type').value;
    alert(getValue);

  }
  return (
    <>
      <button className="Form_Button" onClick={handleShow}>
        <ion-icon name="reader" />
      </button>
      <Modal show={show} onHide={handleClose} size="xl">
        <Modal.Body>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <table style={{ border: "0.3px solid gray", background: "#f2f1f1" }}>
            <tr>
              <td style={cellStyle1}>Rake Name</td>
              <td style={cellStyle2}>
                <select className="Rake_Name_Dropdown_Popup_Form">
                  <option value="" disabled selected>
                    Select an option
                  </option>
                  <option value="option2">CON E</option>
                  <option value="option3">BOST E</option>
                </select>
              </td>
            </tr>
            <tr>
              <td style={cellStyle1}>Rake ID</td>
              <td style={cellStyle2}>
                <input
                  type="text"
                  readOnly={true}
                  placeholder="R202209281118071748989"
                  className="Rake_Id_Popup_Form"
                />
              </td>
            </tr>
            <tr>
              <td style={cellStyle1}>Loaded type</td>
              <td style={cellStyle2}>
                <select className="Loaded_Type_Popup_Form" id="Loaded_type">
                  <option value="1" disabled selected onSelect={getit}>
                    Select an option
                  </option>
                  <option value="Loaded">
                    Loaded
                  </option>
                  <option value="Empty">
                    Empty
                  </option>
                </select>
              </td>
            </tr>
            <tr>
              <td style={cellStyle1}>
                <div>
                  {(() => {
                    if (getValue === "Loaded") {
                      return <p>Condition is true</p>;
                    } else {
                      return <p>Condition is false</p>;
                    }
                  })()}
                </div>
              </td>
              <td style={cellStyle2}></td>
            </tr>
          </table>
          <table
            style={{ border: "0.3px solid gray", background: "#f2f1f1" }}
            className="right_table_popup"
          >
            <tr>
              <td style={cellStyle1}>Rake Name</td>
              <td style={cellStyle2}></td>
            </tr>
          </table>
        </Modal.Body>
      </Modal>
    </>
  );
}

export default RakeForm;
